book,"'Do Androids Dream of Electric Sheep?',Philip K. Dick and Roger Zelazny,'It was January 2021 and Rick Deckard had a license to kill. Somewhere among the hordes of humans out there lurked several rogue androids. Deckard's assignment--find them and then...'retire' them. Trouble was the androids all looked exactly like humans and they didn't want to be found!'":"'The Hitchhiker's Guide to the Galaxy',Douglas Adams,'Seconds before the Earth is demolished to make way for a galactic freeway Arthur Dent is plucked off the planet by his friend Ford Prefect, a researcher for the revised edition of The Hitchhiker's Guide to the Galaxy who, for the last fifteen years, has been posing as an out-of-work actor.'":"'To Kill a Mockingbird',Harper Lee,'The unforgettable novel of a childhood in a sleepy Southern town and the crisis of conscience that rocked it, To Kill A Mockingbird became both an instant bestseller and a critical success when it was first published in 1960. It went on to win the Pulitzer Prize in 1961 and was later made into an Academy Award-winning film, also a classic.'":"'The Kingdom of Back',Marie Lu,Two siblings. Two brilliant talents. But only one Mozart. \n\n[half]Born with a gift for music, Nannerl Mozart has just one wish—to be remembered forever. But even as she delights audiences with her masterful playing, she has little hope she'll ever become the acclaimed composer she longs to be. She is a young woman in 18th century Europe, and that means composing is forbidden to her. She will perform only until she reaches a marriageable age—her tyrannical father has made that much clear.\n\n[half]And as Nannerl's hope grows dimmer with each passing year, the talents of her beloved younger brother, Wolfgang, only seem to shine brighter. His brilliance begins to eclipse her own, until one day a mysterious stranger from a magical land appears with an irresistible offer. He has the power to make her wish come true—but his help may cost her everything.\n\n[half]In her first work of historical fiction, #1 New York Times bestselling author Marie Lu spins a lush, lyrically-told story of music, magic, and the unbreakable bond between a brother and sister.":"'We Are Totally Normal',Rahul Kanakia,'Nandan’s got a plan to make his junior year perfect. He’s going to make sure all the parties are chill, he’s going to smooth things over with his ex, and he’s going to help his friend Dave get into the popular crowd—whether Dave wants to or not. The high school social scene might be complicated, but Nandan is sure he’s cracked the code.\n\n[half]Then, one night after a party, Dave and Nandan hook up, which was not part of the plan—especially because Nandan has never been into guys. Still, Dave’s cool, and Nandan’s willing to give it a shot, even if that means everyone starts to see him differently.\n\n[half]But while Dave takes to their new relationship with ease, Nandan’s completely out of his depth. And the more his anxiety grows about what his sexuality means for himself, his friends, and his social life, the more he wonders whether he can just take it all back. But is breaking up with the only person who’s ever really gotten him worth feeling “normal” again?\n\n[half]From Rahul Kanakia comes a raw and deeply felt story about rejecting labels, seeking connection, and finding yourself.'":"'Wicked As You Wish',,'When a hidden prince, a girl with secrets, a ragtag group of unlikely heroes, and a legendary firebird come together…something wicked is going down.\n\n[half]Many years ago, the magical Kingdom of Avalon was left encased in ice when the Snow Queen waged war. Its former citizens are now refugees in a world mostly devoid of magic. Which is why the crown prince and his protectors are stuck in…Arizona. \n\n[half]Prince Alexei, the sole survivor of the Avalon royal family, is hiding in a town so boring, magic doesn’t even work there. Few know his secret identity, but his friend Tala is one of them. \n\n[half]A new hope for their abandoned homeland reignites when a famous creature of legend, the Firebird, appears for the first time in decades. Alex and Tala must unite with a ragtag group of new friends to journey back to Avalon for a showdown that will change the world as they know it.'":"":"":"":"":"":IVOID:IVOID:IVOID:IVOID:IVOID:IVOID:IVOID:IVOID:IVOID:IVOID:"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"":"",,
